package main

import (
	"testing"
	"time"

	"github.com/msrevive/nexus2/pkg/database/schema"
	"github.com/msrevive/nexus2/pkg/database/bsoncoder"

	json "github.com/goccy/go-json"
	"github.com/google/uuid"
)

func Benchmark_BSON(b *testing.B) {
	char := schema.Character{
		ID: uuid.New(),
		SteamID: "121465453546544656",
		Slot: 1,
		CreatedAt: time.Now().UTC(),
		Data: schema.CharacterData{
			CreatedAt: time.Now().UTC(),
			Size: 5514,
			Data: "",
		},
	}

	_,_ = bsoncoder.Encode(&char)
}

func Benchmark_JSON(b * testing.B) {
	char := schema.Character{
		ID: uuid.New(),
		SteamID: "121465453546544656",
		Slot: 1,
		CreatedAt: time.Now().UTC(),
		Data: schema.CharacterData{
			CreatedAt: time.Now().UTC(),
			Size: 5514,
			Data: "",
		},
	}

	_,_ = json.Marshal(&char)
}